import React from "react";
import { Input } from "@chakra-ui/react";
import styles from './UserForm.module.css'
import classNames from 'classnames';

export default function InputInfos({ name, value, placeholder, onChange, className }) {

  const combinedClassNames = classNames(styles.fieldtext, styles.anothertext);

  return (


    <Input
      className={combinedClassNames}
      variant="filled"
      name={name}
      value={value}
      placeholder={placeholder}
      onChange={onChange}
    />
  );
}
